<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Animated Diwali Wishes</title>
    <style>
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            margin: 0;
            padding: 0;
            background-color: #001f3f;
            color: #fff;
        }

        header {
            text-align: center;
            padding: 30px;
            background-color: #ffcc00;
            color: #f10505;
            position: relative;
            overflow: hidden;
        }

        h1 {
            font-size: 3em;
            margin-bottom: 10px;
            opacity: 0;
            transform: translateY(50px);
            animation: fadeInUp 1.5s forwards 0.5s;
        }

        p {
            font-size: 1.2em;
            line-height: 1.6;
            color: #eae7e7;
            opacity: 0;
            transform: translateY(30px);
            animation: fadeInUp 1.5s forwards 1s;
        }

        @keyframes fadeInUp {
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .diwali-image {
            width: 100%;
            max-width: 600px;
            height: auto;
            border-radius: 8px;
            margin: 20px auto;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.2);
            opacity: 0;
            transform: translateY(30px);
            animation: fadeInUp 1.5s forwards 1.5s;
        }

        section {
            text-align: center;
            padding: 20px;
            opacity: 0;
            transform: translateY(30px);
            animation: fadeInUp 1.5s forwards 2s;
        }

        .decorations {
            display: flex;
            justify-content: center;
            margin-top: 30px;
            opacity: 0;
            transform: translateY(30px);
            animation: fadeInUp 1.5s forwards 2.5s;
        }

        .decorations img {
            width: 100px;
            height: auto;
            margin: 0 10px;
        }

        footer {
            text-align: center;
            padding: 20px;
            background-color: #ffcc00;
            color: #333;
            position: relative;
            overflow: hidden;
        }

        @keyframes slideIn {
            to {
                left: 0;
            }
        }
